import { CST } from '../const/CST';
export class LoadScene extends Phaser.Scene{
    constructor(){
        super({
            key: CST.SCENES.LOAD
        })
    }
    init(){

    }
    preload(){
        this.load.image('redPlane', '../../assets/Biplane.png');
        this.load.image('svgPlane', '../../assets/spacey.svg');
        this.load.spritesheet('planeSvg', '../../assets/spacey.svg', {
            frameHeight: 32,
            frameWidth: 32
        });
        this.load.image('sky1', '../../assets/sky1.png');
        this.load.image('logo', '../../assets/logo.png');

        let loadingBar = this.add.graphics({
            fillStyle: {
                color: 0xffffff,
                alpha: 1
            }
        })

        var width = this.cameras.main.width;
        var height = this.cameras.main.height;
        var loadingText = this.make.text({
            x: width / 2,
            y: height / 2 - 50,
            text: 'Loading...',
            style: {
                fontFamily: 'arcadeFont',
                fontSize: '20px',
                color: '#ffffff'
            }
        });
        loadingText.setOrigin(0.5, 0.5);

        var percentText = this.make.text({
            x: width / 2,
            y: height / 2 - 5,
            text: '0%',
            style: {
                fontFamily: 'arcadeFont',
                fontSize: '18px',
                color: '#ffffff'
            }
        }).setDepth(1);
        percentText.setOrigin(0.5, 0.5);

        var assetText = this.make.text({
            x: width / 2,
            y: height / 2 + 50,
            text: '',
            style: {
                fontFamily: 'arcadeFont',
                fontSize: '18px',
                color: '#ffffff'
            }
        });
        assetText.setOrigin(0.5, 0.5);

        let loadingBox = this.add.graphics({
            fillStyle: {
                color: 0x222222,
                alpha: 0.8
            }
        }).fillRect(
            this.game.renderer.width / 2 - 160,
            this.game.renderer.height / 2 - 30,
            320,
            50
        );

        this.load.on('progress', (percent :number) => {
            loadingBar.clear();
            loadingBar.fillRect(
                this.game.renderer.width / 2 - 150,
                this.game.renderer.height / 2 - 20,
                300 * percent,
                30
            );
            percentText.setText((percent * 100).toString() + '%');
        })

        this.load.on('fileprogress', (file :Phaser.Loader.File) => {
            assetText.setText('Loading asset: ' + file.key);
        })

        this.load.on('complete', () => {
            loadingBar.destroy();
            loadingBox.destroy();
            loadingText.destroy();
            percentText.destroy();
            assetText.destroy();
            this.cameras.main.backgroundColor.setTo(21, 21, 21);

            let logoLine = this.add.graphics({
                fillStyle: {
                    color: 0xeaeaea
                }
            }).fillRect(325, -600, 66, 600);

            this.tweens.timeline({
                tweens: [{
                    targets: logoLine,
                    y: 600,
                    ease: 'Power1',
                    duration: 1000
                }]
            });
            
            this.time.addEvent({
                delay: 1000,
                callback: ()=>{
                    let img = this.add.image(75, 0, 'logo').setOrigin(0).setScale(0.65).setAlpha(0);
                    this.tweens.timeline({
                        tweens: [{
                            targets: img,
                            alpha: 1,
                            ease: 'Power1',
                            duration: 1000
                        }]
                    });
                    this.time.addEvent({
                        delay: 2000,
                        callback: ()=> {
                            this.tweens.timeline({
                                tweens: [{
                                    targets: img,
                                    alpha: 0,
                                    ease: 'Power1',
                                    duration: 2000
                                }]
                            });
                            this.time.addEvent({
                                delay: 2000,
                                callback: ()=> {
                                    this.tweens.timeline({
                                        tweens: [{
                                            targets: logoLine,
                                            x: -6700,
                                            scale: 20,
                                            ease: 'Linear',
                                            duration: 3000
                                        }]
                                    });
                                },
                                loop: false
                            })
                        },
                        loop: false
                    })
                },
                loop: false
            })
        })
    }
    create(){
        this.time.addEvent({
            delay: 7000,
            callback: ()=>{
                this.scene.start(CST.SCENES.MENU)
            },
            loop: false
        })
    }
}
